import { logoutUser } from "../actions";
import { connect } from "react-redux";
import { Container, Menu, Button } from "semantic-ui-react";

const styleBar = {
  overflow: "hidden",
  backgroundColor: "#5400E8"
  // position: 'fixed',
  // top: '0',
  // width: '100%'
};

const styleLink = {
  float: "right",
  display: "block",
  color: "#f2f2f2",
  textAlign: "center",
  padding: "14px 16px",
  fontSize: "17px",
  textDecoration: "none"
};

class Navbar extends React.Component {



  handleLogout = () => {
    this.props.logoutUser();
    localStorage.removeItem("token");
    this.props.history.push("/");
    // redirect to login page
  };



  render() {
    return (
      <div className="navbar">
        <Container>
          <Menu.Item as={Link} to="/" active>
            Home
          </Menu.Item>
          <Menu.Item as={Link} to="/leadlists">
            Dashboard
          </Menu.Item>
          <Menu.Item as={Link} to="/profile">
            My Profile
          </Menu.Item>
          <Menu.Item as={Link} to="/results">
            Results
          </Menu.Item>
          <Menu.Item position="right">
            <Button as={Link} to="/login" inverted={!fixed}>
              Log in
            </Button>
            <Button
              as={Link}
              to="/signup"
              inverted={!fixed}
              primary={fixed}
              style={{ marginLeft: "0.5em" }}
            >
              Sign Up
            </Button>
          </Menu.Item>
        </Container>
        {/* <NavLink style={styleLink} onClick={() => this.handleLogout()}>Logout</NavLink>
      <NavLink style={styleLink} to="/leadlists">Dashboard</NavLink>
      <NavLink style={styleLink} to="/results">Results</NavLink>
      <NavLink style={styleLink} to="/profile">My Profile</NavLink>
      <NavLink style={styleLink} to="/search">Home</NavLink> */}
      </div>
    );
  }
}

function mapDispatchToProps(dispatch) {
  return {
    logoutUser: () => dispatch(logoutUser())
  };
}

export default connect(
  null,
  mapDispatchToProps
)(Navbar);
